class Solution {
  int minimumChanges(String s, int k) {
    int n = s.length;
    List<List<int>> dp = List.generate(k + 1, (_) => List.generate(n + 1, (_) => 1 << 20));
    List<List<int>> cost = List.generate(n, (_) => List.generate(n, (_) => 0));

    for (int i = 0; i < n; i++) {
      for (int j = i; j < n; j++) {
        int changes = 0;
        for (int l = i, r = j; l < r; l++, r--) {
          if (s[l] != s[r]) changes++;
        }
        cost[i][j] = changes;
      }
    }

    dp[0][0] = 0;
    for (int i = 1; i <= k; i++) {
      for (int j = 1; j <= n; j++) {
        for (int l = 0; l < j; l++) {
          dp[i][j] = min(dp[i][j], dp[i - 1][l] + cost[l][j - 1]);
        }
      }
    }

    return dp[k][n];
  }

  int min(int a, int b) => a < b ? a : b;
}
